function makeTimer(){var e=new Date("26 January 2022 15:00:00 GMT+05:30");e=Date.parse(e)/1e3;var t=new Date,a=e-(t=Date.parse(t)/1e3),o=Math.floor(a/86400),r=Math.floor((a-86400*o)/3600),h=Math.floor((a-86400*o-3600*r)/60),l=Math.floor(a-86400*o-3600*r-60*h);r<"10"&&(r="0"+r),h<"10"&&(h="0"+h),l<"10"&&(l="0"+l),$("#days").html(o),$("#hours").html(r),$("#minutes").html(h),$("#seconds").html(l)}setInterval(function(){makeTimer()},1e3);